import { Component } from 'react';
import React from 'react';
import {Tab, Tabs, Row} from 'react-bootstrap';

export default class GetEther extends Component {
    handleNextTab = () => {
        this.state.activeTab=((this.state.activeTab + 1) % 3);
        alert()
    };
  constructor(props) {
    super(props);
    this.state = {activeTab: 0};
  }
  render(){
  return (
    <Row className="justify-content-center h6 ">
        <Tabs
            justify 
            defaultActiveKey={this.state.activeTab}
            activeKey={this.state.activeTab}
            >
            <Tab eventKey={0} title="Supply">
                <h2>Content for Tab 1</h2>
                <button onClick={this.handleNextTab}>Next Tab</button>
            </Tab>
            <Tab eventKey={1} title="Borrow">
                <h2>Content for Tab 2</h2>
                <button onClick={this.handleNextTab}>Next Tab</button>
            </Tab>
            <Tab eventKey={2} title="Staking" >
                <h2>Content for Tab 3</h2>
                <button onClick={this.handleNextTab}>Next Tab</button>
            </Tab>
        </Tabs>
    </Row>
  );
}
}
